$(document).ready(function(){$("input[type=checkbox][data-ajaxcheckbox]").each(function(a,b){const c=JSON.parse(atob(b.dataset.ajaxcheckbox));c.ajax_change_link&&$(b).change(function(){il.waiter.show(),$.ajax({url:c.ajax_change_link,type:"POST",data:{checked:b.checked}}).always(function(){il.waiter.hide()})})})});
